import classes from './Checkout.module.css'

let CheckOut = (props)=>{

    let [closeCheckout,setCloseCheckOut] = useState(false)

    let checkOutClose =()=>{
        setCloseCheckOut(true)     
    }

return(
    <div className={classes.form}>
        <form className={classes.control}>
            <label for='fullName'>Your Name</label>
            <input type='text' id='fullName'></input>

            <label htmlFor='Address'> Street Address </label>
            <input type='text' id='Address'></input>

            <label htmlFor='postal'>Postal Code</label>
            <input type='number' id='postal'></input>

            <label htmlFor='city'> City </label>
            <input type='text' id='city'></input>

            <div className={classes.actions}>
                <button type='button' onClick={checkOutClose}> Cancel </button>
 <button> Confirm </button>
 </div>
        </form>
    </div>
)
}

export default CheckOut;
